import { jsPDF } from "jspdf"
var font = '';
var callAddFont = function () {
this.addFileToVFS('alfont_com_AlFont_com_URW-DIN-Arabic-normal.ttf', font);
this.addFont('alfont_com_AlFont_com_URW-DIN-Arabic-normal.ttf', 'alfont_com_AlFont_com_URW-DIN-Arabic', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])
